} AS coords

//Your existing match
MATCH (dist:Distributor)<-[db:DISTRIBUTED_BY]-(prod:Product)
WHERE prod.globalBrand = $globalbrand
  AND prod.strength    = $strength
  AND prod.form        = $form
  AND prod.generation  = $generation


WITH coords, dist, sum(db.demandQty) AS sumDemand
WHERE dist.iso3Code IN keys(coords)

//Create virtual node with a spatial point
CALL apoc.create.vNode(
  ['RegionDemand'],
  {
    iso3Code: dist.iso3Code,
    distributor: dist.name,
    demand: sumDemand,
    location: point({
      latitude:  coords[dist.iso3Code].lat,
      longitude: coords[dist.iso3Code].lon
    })
  }
) YIELD node

RETURN node;

